Angelica's a gamer. She's get several D&amp;D characters and seems like she's always working on a new one. Video games are also on her menu, as are manga and anime. She loves her job and likes cosplay, so modeling not only gives her the flexibility to pursue her interests, but also a chance to explore her characters and costumes.
